import React, { useState, useEffect } from "react";
import { connect } from "react-redux";
import { updateLog } from "../../store/actions/logActions";
import PropTypes from "prop-types";
import M from "materialize-css/dist/js/materialize.min.js";

const FindRoutesModal = ({ route, currentRoute }) => {
  return (
    <div id="find-routes-modal" className="modal" style={modalStyle}>
      <div className="modal-content">
        <h4>Route Info</h4>
        <div>
          <a
            href="#find-routes-modal"
            className={`modal-trigger text-accent-4 blue-text`}
          >
            Route: {route.locationFrom} - {route.locationTo}{" "}
          </a>
          <br />
          <span className="grey-text">
            <span className="black-text">ID #{route.id}</span> posted by{" "}
            <span className="black-text">{route.postedBy}</span> on 01.19.2020
          </span>
          <a href="#!" className="secondary-content">
            <i className="material-icons grey-text">delete</i>
          </a>
        </div>
      </div>
    </div>
  );
};

const modalStyle = {
  width: "75%",
  height: "75%"
};

FindRoutesModal.propTypes = {
  current: PropTypes.object
};

const mapStateToProps = state => ({
  currentRoute: state.route.currentRoutes
});

export default connect(mapStateToProps)(FindRoutesModal);
